00224         private void Oscillate(float lerpT)
00225         {
00226             var start = nodes[0];
00227             var end = nodes[1];
00228 
00229             var posLerped = (posDef.includeAxes == 0) ? new Vector3(0, 0, 0) : Vector3.Lerp(start.trs[0], end.trs[0], lerpT);//  currentLerpT * position.oscillateRange + position.oscillateStart;
00230             var rotLerped = (rotDef.includeAxes == 0) ? new Vector3(0, 0, 0) : Vector3.Lerp(start.trs[1], end.trs[1], lerpT); //currentLerpT * rotation.oscillateRange + rotation.oscillateStart;
00231             var sclLerped = (sclDef.includeAxes == 0) ? new Vector3(1, 1, 1) : Vector3.Lerp(start.trs[2], end.trs[2], lerpT); //currentLerpT * scale.oscillateRange + scale.oscillateStart;
00232 
00233             ApplyOscillate(posLerped, rotLerped, sclLerped);
00234         }
