00275         protected override void ApplySnapshot(Frame snapframe, Frame targframe, bool snapIsVaid, bool targIsValid)
00276         {
00277             if (snapIsVaid && snapframe.content == FrameContents.Complete)
00278             {
00279                 if (movement == Movement.Oscillate)
00280                 {
00281                     if (predictWithRTT != 0)
00282                     {
00283                         //snapPhase = targPhase;
00284 
00285                         float nudge = (NetMaster.RTT + TickEngineSettings.targetBufferInterval) * predictWithRTT;
00286                         float nudgedSnapTime = snapframe.phase * oscillatePeriod + nudge;
00287                         float nudgedTargtime = targframe.phase * oscillatePeriod + nudge;
00288 
00289                         //Debug.Log(nudge + " time: " + targPhase * oscillatePeriod +
00290                         //  " nudged: " + nudgedTargtime + " origphase: " + targPhase + " newphase: " + TimeToPhase(nudgedTargtime));
00291 
00292                         snapPhase = TimeToPhase(nudgedSnapTime);
00293                         targPhase = TimeToPhase(nudgedTargtime);
00294                     }
00295                     else
00296                     {
00297                         snapPhase = snapframe.phase;
00298                         targPhase = targframe.phase;
00299                     }
00300 
00301                     float lerpT = (float)OscillatePhaseToLerpT(snapPhase);
00302                     Oscillate(lerpT);
00303                 }
00304             }
00305         }
