00308         public override bool OnInterpolate(int snapFrameId, int targFrameId, float t)
00309         {
00310 
00311             if (!base.OnInterpolate(snapFrameId, targFrameId, t))
00312                 return false;
00313 
00314             switch (movement)
00315             {
00316                 case Movement.Oscillate:
00317                     {
00318 
00319                         if (targPhase < snapPhase)
00320                             targPhase += 1;
00321 
00322                         float phase = Mathf.Lerp(snapPhase, targPhase, t);
00323 
00324                         if (phase >= 1)
00325                             phase -= 1;
00326 
00327                         var lerpT = (float)OscillatePhaseToLerpT(phase);
00328 
00329                         Oscillate(lerpT);
00330                         return true;
00331                     }
00332 
00333                 case Movement.Trigger:
00334                     {
00335                         break;
00336                     }
00337                 default:
00338                     break;
00339             }
00340 
00341             return false;
00342 
00343         }
