00347         protected override void ConstructMissingFrame(Frame prevFrame, Frame snapframe, Frame targframe)
00348         {
00349             //base.ConstructMissingFrame(frameId);
00350             switch (movement)
00351             {
00352                 // Oscilate is deterministic in nature. So for missing frames we can turn the previous t back into a moduls time value, 
00353                 // and accurately predict t by adding a tick worth of time to that.
00354                 case Movement.Oscillate:
00355                     {
00356                         if (snapframe.content == FrameContents.Complete)
00357                         {
00358                             float restoredTime = snapframe.phase * oscillatePeriod;
00359                             float extrapTime = restoredTime + TickEngineSettings.netTickInterval;
00360                             targframe.phase = TimeToPhase(extrapTime);
00361                             targframe.content = FrameContents.Complete;
00362                             return;
00363                         }
00364                         break;
00365                     }
00366 
00367                 default:
00368                     break;
00369             }
00370         }
