00398         private void ApplyOscillate(Vector3 pos, Vector3 rot, Vector3 scl)
00399         {
00400             var posIncludeAxes = posDef.includeAxes;
00401             var rotIncludeAxes = rotDef.includeAxes;
00402             var sclIncludeAxes = sclDef.includeAxes;
00403 
00404 
00405             // Scale
00406             if (sclIncludeAxes != AxisMask.None)
00407             {
00408                 transform.localScale = new Vector3(
00409                     ((sclIncludeAxes & AxisMask.X) != 0) ? scl.x : transform.localScale.x,
00410                     ((sclIncludeAxes & AxisMask.Y) != 0) ? scl.y : transform.localScale.y,
00411                     ((sclIncludeAxes & AxisMask.Z) != 0) ? scl.z : transform.localScale.z);
00412             }
00413 
00414             // Rotation
00415             if (rotIncludeAxes != AxisMask.None)
00416             {
00417                 if (rotDef.local)
00418                 {
00419                     transform.localEulerAngles = new Vector3(
00420                         ((rotIncludeAxes & AxisMask.X) != 0) ? rot.x : transform.localEulerAngles.x,
00421                         ((rotIncludeAxes & AxisMask.Y) != 0) ? rot.y : transform.localEulerAngles.y,
00422                         ((rotIncludeAxes & AxisMask.Z) != 0) ? rot.z : transform.localEulerAngles.z);
00423                 }
00424                 else
00425                 {
00426                     transform.eulerAngles = new Vector3(
00427                         ((rotIncludeAxes & AxisMask.X) != 0) ? rot.x : transform.eulerAngles.x,
00428                         ((rotIncludeAxes & AxisMask.Y) != 0) ? rot.y : transform.eulerAngles.y,
00429                         ((rotIncludeAxes & AxisMask.Z) != 0) ? rot.z : transform.eulerAngles.z);
00430                 }
00431             }
00432 
00433             // Position
00434             if (posIncludeAxes != AxisMask.None)
00435             {
00436                 if (posDef.local)
00437                 {
00438                     transform.localPosition = new Vector3(
00439                         ((posIncludeAxes & AxisMask.X) != 0) ? pos.x : transform.localPosition.x,
00440                         ((posIncludeAxes & AxisMask.Y) != 0) ? pos.y : transform.localPosition.y,
00441                         ((posIncludeAxes & AxisMask.Z) != 0) ? pos.z : transform.localPosition.z);
00442                 }
00443                 else
00444                 {
00445                     transform.position = new Vector3(
00446                         ((posIncludeAxes & AxisMask.X) != 0) ? pos.x : transform.position.x,
00447                         ((posIncludeAxes & AxisMask.Y) != 0) ? pos.y : transform.position.y,
00448                         ((posIncludeAxes & AxisMask.Z) != 0) ? pos.z : transform.position.z);
00449                 }
00450             }
00451 
00452         }
