00758         protected float DrawVerticalAxis(SerializedProperty element, int axis, AxisMask mask)
00759         {
00760             //EditorGUILayout.BeginHorizontal();
00761 
00762             bool use = ((int)mask & (1 << axis)) != 0;
00763             float oldval = element.vector3Value[axis];
00764             EditorGUI.BeginDisabledGroup(!use);
00765             //EditorGUILayout.LabelField(" ?", GUILayout.MaxWidth(AXIS_LAB_WID));
00766             float newval = EditorGUILayout.DelayedFloatField(oldval, GUILayout.MinWidth(FLOAT_WIDTH));
00767             newval = (use) ? newval : 0;
00768             EditorGUI.EndDisabledGroup();
00769 
00770             //EditorGUILayout.EndHorizontal();
00771 
00772             return newval;
00773         }
