00783         protected void DrawAxes(SerializedProperty v3, AxisMask axis)
00784         {
00785             const float FLOAT_WIDTH = 10f;
00786             var oldval = v3.vector3Value;
00787 
00788             float x, y, z;
00789 
00790             bool usex = (axis & AxisMask.X) != 0;
00791             bool usey = (axis & AxisMask.Y) != 0;
00792             bool usez = (axis & AxisMask.Z) != 0;
00793 
00795             EditorGUI.BeginDisabledGroup(!usex);
00796             EditorGUILayout.LabelField(" x", GUILayout.MaxWidth(AXIS_LAB_WID));
00797             float newx = EditorGUILayout.DelayedFloatField(oldval.x, GUILayout.MinWidth(FLOAT_WIDTH));
00798             x = (usex) ? newx : 0;
00799             EditorGUI.EndDisabledGroup();
00800 
00802             EditorGUI.BeginDisabledGroup(!usey);
00803             EditorGUILayout.LabelField(" y", GUILayout.MaxWidth(AXIS_LAB_WID));
00804             float newy = EditorGUILayout.DelayedFloatField(oldval.y, GUILayout.MinWidth(FLOAT_WIDTH));
00805             y = (usey) ? newy : 0;
00806             EditorGUI.EndDisabledGroup();
00807 
00808 
00810             EditorGUI.BeginDisabledGroup(!usez);
00811             EditorGUILayout.LabelField(" z", GUILayout.MaxWidth(AXIS_LAB_WID));
00812             float newz = EditorGUILayout.DelayedFloatField(oldval.z, GUILayout.MinWidth(FLOAT_WIDTH));
00813             z = (usez) ? newz : 0;
00814             EditorGUI.EndDisabledGroup();
00815 
00816             var newval = new Vector3(x, y, z);
00817             if (v3.vector3Value != newval)
00818                 v3.vector3Value = newval;
00819         }
